    [],nt"revision_timestamp": "2015-01-22T15:57:57.041015",nt"name": "public-housing-agency-pha-inventory",nt"isopen":
    false,nt"url": null,nt"notes": "The dataset contains current data on low
    rent and Section 8 units in PHA's administered by HUD. The Section 8 Rental Voucher
    Program increases affordable housing choices for very low-income households by allowing
    families to choose privately owned rental housing. Through the Section 8 Rental
    Voucher Program, the administering housing authority issues a voucher to an income-qualified
    household, which then finds a unit to rent. If the unit meets the Section 8 quality
    standards, the PHA then pays the landlord the amount equal to the difference between
    30 percent of the tenant's adjusted income (or 10 percent of the gross income or
    the portion of welfare assistance designated for housing) and the PHA-determined
    payment standard for the area. The rent must be reasonable compared with similar
    unassisted units.",nt"license_title": "License Not Specified",nt"extras":
